import React from 'react';

const navbar = () => {
  return (
    <div>
      <nav className="nav">
        <div className="menu"></div>
        <h1>MENU</h1>
        <ul>
          <li>Home</li>
          <li>About</li>
          <li>Resume</li>
          <li>Portfolio</li>
          <li>Contact</li>
        </ul>
      </nav>
    </div>
  );
};

export default navbar;
